import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div>
        <Header />
        <Techno />
    </div>
  );
}

const Header = () => {
    return (
     <div>
        <a>First</a>
    </div>
);
}

const Techno = () => {
    return (
        <div className="App">
            Second
        </div>
    );
}

export default App;
